import { describe, expect, it, vi } from 'vitest';
import { base64ToBlob, blobToBase64 } from '../index';

describe('blob api test', () => {
  it('测试 blobToBase64 正常情况', async () => {
    expect(await blobToBase64(new File([new Blob()], 'xxx.png'))).toEqual({
      base64Url: 'data:application/octet-stream;base64,W29iamVjdCBCbG9iXQ==',
      msg: 'success',
    });

    const fileReader: any = new FileReader();

    fileReader.readAsDataURL = vi.fn().mockImplementation(() => {
      fileReader.onerror = new Error('File read error');
      setTimeout(() => fileReader.onerror(new Event('error')));
    });

    (window as any).FileReader = vi.fn(() => fileReader);

    expect(await blobToBase64(new File([new Blob()], ''))).toEqual({
      msg: 'file error',
      base64Url: null,
    });
  });
  it('测试 blobToBase64 失败情况', async () => {
    const fileReader: any = new FileReader();

    fileReader.readAsDataURL = vi.fn().mockImplementation(() => {
      fileReader.onerror = new Error('File read error');
      setTimeout(() => fileReader.onerror(new Event('error')));
    });

    (window as any).FileReader = vi.fn(() => fileReader);

    expect(await blobToBase64(new File([new Blob()], ''))).toEqual({
      msg: 'file error',
      base64Url: null,
    });
  });
  it('测试 base64 对象 转 Blob 异常情况情况 ', async () => {
    window.URL.createObjectURL = vi.fn();

    const result = await base64ToBlob({ base64Str: '', fileName: '1', contentType: 'jpg' });

    expect(result).toEqual({
      preview: '',
      name: '',
    });
  });

  it('测试 ase64 对象 转 Blob 正常情况 ', async () => {
    const base64 = ` The string to be decoded contains invalid characters. data:image/jpg;base64,`;

    window.URL.createObjectURL = vi.fn();

    const result = await base64ToBlob({ base64Str: base64, fileName: '1', contentType: 'jpg' });

    expect(result instanceof Blob).toEqual(true);
  });
});
